import React from 'react';
import image from '../resources/logo.png'
const Navbar = () => {
    return (
        <div>
            <div className="Navbar">
                <div className='Logo'>
                    <img src={image} alt='logo'/>
                </div>
                <div className='Serchbox'></div>
                <div className='links'>
                    <a></a>
                </div>
            </div>
        </div>
    );
}

export default Navbar;
